import React from 'react';
import './Exercise.css';
import {Link} from 'react-router-dom';

function search(event){
    event.preventDefault();
    console.log('search');
};

function reset(event){
    event.preventDefault();
    console.log('reset');
}

function Exercise(){
    return (
        <>
            <ul class="menu">
                <li>
                    <a href="../workout/workout.html" class="active" title="Workout"><i class="fa-solid fa-dumbbell"></i></a>
                </li>
                <li>
                    <a href="../../profile/profile.html" title="Account Settings"><i class="fa-solid fa-user"></i></a>
                </li>
            </ul>
            <ul class="menu_2">
                <li>
                    <a href="../../../home/home.html"><i class="fa-solid fa-house"></i></a>
                </li>
                <li style="float: right">
                    <a href="../../../index.html">Log out</a>
                </li>
            </ul>
            <ul className="search-exercise">
                <li className='searchBar-exercise'>
                    <input type="text" placeholder="Search..." tabIndex="5" id='searchBar-exercise'/>
                </li>
                <li tabIndex="8" id="add-exercise">
                    <Link to="/workout/new_workout" className='menu-link' title='New Exercise'>
                        <i className="fa-solid fa-plus"/>
                    </Link>
                </li>
                <li tabIndex="6" id="search-exercise">
                    <Link to='#' title="Search" className='menu-link' 
                    onClick={search}>
                        <i className="fa-solid fa-magnifying-glass"/>
                    </Link>
                </li>
                <li tabIndex="7" id="search-exercise">
                    <Link to='#' type="reset" title="Reset" className='menu-link' 
                    onClick={reset}>
                        <i className="fa-solid fa-x"/>
                    </Link>
                </li>
            </ul>
        </>
    );
}

export default Exercise;
